import React from "react";
import "./App.css";
import "./reset.css";

function App() {
  return (
    <div className="wrap">
      <div className="box">
        <div className="boxTop">
          <h2>To-Do-List</h2>
          <ul>
            <li></li>
          </ul>
        </div>
        <div className="boxLeft"></div>
        <div className="boxRight"></div>
      </div>
    </div>
  );
}

export default App;
